import React from 'react'
import './Join.css'


import {

    Element,

} from "react-scroll";

class Join extends React.Component {


    render() {
        return (

            <>
                <Element name="join" className="element"></Element>
                <div className='join'>

                    <h1 className='scaled-title'>JOIN US!</h1>
                    <p>Joining the society is the easiest way to keep up with what the society is doing. Doing so is <strong>FREE</strong> through the SU!</p>


                </div>
            </>


        );
    }
}
export default Join;
